import React from 'react';
import ReactDOM from 'react-dom';
import { Header } from './Header';
import './index.css';
import Netflix from './Netflix';
import Amazon from './Amazon';


let series = 'netflix'

const FavSeries = () =>{
    if(series === 'amazon'){
        return  <Amazon />     
    }else{
        return  <Netflix />
    }
}



ReactDOM.render(
    <React.Fragment>

        {/* header component */}
        <Header />


        {/* main card component */}
        <div className="cards">
            <FavSeries />

        </div>
    </React.Fragment>,
    document.getElementById('root')
);
